const Footer = () => {
    return (
        <div className="container-page">
            <div className="container-img-publicidad">
                <img src="img-1.jpeg" alt="anuncio" />
                <img src="img-2.webp" alt="anuncio" />
            </div>
            <footer>Coderhouse 2023</footer>
        </div>
    );
};

export default Footer;
